// src/components/Header.jsx
import React from "react";
import "./Header.css";
import { FaUserCircle } from "react-icons/fa";
import { NavLink, useNavigate } from "react-router-dom";

const Header = () => {
  const navigate = useNavigate();

  // Always intercept Dataset: go to Login first, then bounce to /dataset
  const handleDatasetClick = (e) => {
    e.preventDefault();
    navigate("/login", { state: { from: { pathname: "/dataset" } } });
  };

  // Header login button: same behavior → Login, then /dataset
  const goLoginForDataset = () => {
    navigate("/login", { state: { from: { pathname: "/dataset" } } });
  };

  return (
    <header className="md-header">
      <nav className="md-nav">
        <ul>
          <li className="brand">
            <NavLink to="/" end>
              Micro-Doppler Project
            </NavLink>
          </li>
          <li>
            <NavLink to="/description">Project Description</NavLink>
          </li>
          <li>
            <NavLink to="/research">Research Paper</NavLink>
          </li>
          <li>
            <NavLink to="/contributors">Contributors</NavLink>
          </li>
          <li>
            {/* ✅ Always show LoginPage first, then go to /dataset */}
            <NavLink to="/dataset" onClick={handleDatasetClick}>
              Dataset
            </NavLink>
          </li>
          <li>
            <NavLink to="/feedback">Feedback</NavLink>
          </li>
        </ul>
      </nav>

      <div className="login-section">
        <button
          className="login-btn"
          onClick={goLoginForDataset}
          aria-label="Login"
        >
          <FaUserCircle className="login-icon" />
          Login
        </button>
      </div>
    </header>
  );
};

export default Header;
